using FluentAssertions;
using NoteList.Domain.Commands;
using NoteList.Repository.FacadeTests.Support;
using System.Threading.Tasks;
using Xunit;

namespace NoteList.Repository.FacadeTests
{
    public class BaseAssertFacade : WebApp
    {
        [Fact]
        public async Task CreateTag()
        {
            var response = await TagFacade.Post(new TagCommand
            {
                Name = "Tag Name"
            });

            response.Name.Should().BeEquivalentTo("Tag Name");
        }

        [Fact]
        public async Task CreateNoteList()
        {
            var response = await ListFacade.Post(new NoteListCommand
            {
                Name = "List Name"
            });

            response.Name.Should().BeEquivalentTo("List Name");
        }

        [Fact]
        public async Task CreateNoteItem()
        {
            var responseList = await ListFacade.Post(new NoteListCommand
            {
                Name = "List Name"
            });

            var responseItem = await ItemFacade.Post(new NoteItemCommand
            {
                NoteText = "Any Note Text",
                NoteListId = responseList.Id
            });

            responseItem.NoteText.Should().BeEquivalentTo("Any Note Text");
        }

        [Fact]
        public async Task CreateNoteTagLink()
        {
            var responseList = await ListFacade.Post(new NoteListCommand
            {
                Name = "List Name"
            });

            var responseItem = await ItemFacade.Post(new NoteItemCommand
            {
                NoteText = "Any Note Text",
                NoteListId = responseList.Id
            });

            var responseTag = await TagFacade.Post(new TagCommand
            {
                Name = "Tag Name"
            });

            await NoteTagLink.CreateLink(new NoteTagLinkCommand
            {
                NoteItemId = responseItem.Id,
                TagId = responseTag.Id
            });
        }

        [Fact]
        public async Task CreateNoteImage()
        {
            var responseList = await ListFacade.Post(new NoteListCommand
            {
                Name = "List Name"
            });

            var responseItem = await ItemFacade.Post(new NoteItemCommand
            {
                NoteText = "Any Note Text",
                NoteListId = responseList.Id
            });

            var responseImage = await ImageFacade.Post(new NoteImageCommand
            {
                NoteItemId = responseItem.Id,
                ImageData = ""
            });

            responseImage.ImageData.Should().BeEquivalentTo("");
        }
    }
}
